import axios from 'axios'

export default class Home extends Component {
    state={
        quest: {}
    }
    componentDidMount(){
      axios.get("http://localhost:8080/quests/1")
      .then( response => (
          this.setState({quest:response.data})
      ) 
      )
    }
    test = () =>{
        axios.get("http://localhost:8080/quests/1")
        .then( response => (
            this.setState({quest:response.data})
        ) 
        )
    }
    render() {
        return (
            <div>
